create table rental_data (
	id_rent VARCHAR(40),
	id_user_rental VARCHAR(40),
	id_video_games_rental VARCHAR(40),
	rental_date DATE,
	rental_end_date DATE,
	PRIMARY KEY(id_rent),
	CONSTRAINT fk_usesr_rental FOREIGN KEY(id_user_rental) REFERENCES [dbo].[users_data](id_user),
	CONSTRAINT fk_video_games_rental FOREIGN KEY(id_video_games_rental) REFERENCES [dbo].[video_game_data](id_game)
);
